import React from "react";

const WorkItems = [{ title: "website", url: "", img: "", text: "" }];

const WorkItem = () => {
  return (
    <WorkItem>
      <h2>{title}</h2>
      <p>{url}</p>
      <img src="{img}" />
      <p>{text}</p>
    </WorkItem>
  );
};

export default WorkItem;
